using System;
using Bridge;
using Bridge.Html5;
using ExpressCraft;
using System.Text;
using static ExpressCraft.Network;
using System.Threading;
using System.Threading.Tasks;
using Bridge.jQuery2;

namespace ExpressCraftHelloWorldDialog
{
    public class App
    {
        public static Random r = new Random();

        public static void Main()
        {
            // Setup the form events and containers*
            Form.Setup();
			GoogleCloudPrint.Setup();
			AceCodeEditor.Setup();
			Firebase.Setup(() => {
				//Firebase.InitializeApp(
				//	);
			});

			Settings.AllowCloseWithoutQuestion = true;

            var dialogTestButton = new SimpleButton()
            {
                Text = "dialog test",
                ItemClick = (ev) =>
                {

                   
                }
            };

            var errorBtn = new SimpleButton()
            {
                Text = MessageBoxLayout.Error.ToString("G"),
                ItemClick = (ev) =>
                {
                    (new MessageBoxForm("Hello World!", MessageBoxLayout.Error)).ShowDialog();
                }
            };
            
            var exclamationBtn = new SimpleButton()
            {
                Text = MessageBoxLayout.Exclamation.ToString("G"),
                ItemClick = (ev) =>
                {
                    (new MessageBoxForm("Hello World!", MessageBoxLayout.Exclamation)).ShowDialog();
                }
            };
            
            var informationBtn = new SimpleButton()
            {
                Text = MessageBoxLayout.Information.ToString("G"),
                ItemClick = (ev) =>
                {
                    (new MessageBoxForm("Dear Customer, Please call us regarding your AV RECEIVER. Plse quote your job number 262523.Rgds Camtec 0862580077.", MessageBoxLayout.Information)).ShowDialog();
                }
            };
            
            var questionBtn = new SimpleButton()
            {
                Text = MessageBoxLayout.Question.ToString("G"),
                ItemClick = (ev) =>
                {
                    (new MessageBoxForm("Hello World!", MessageBoxLayout.Question)).ShowDialog();
                }
            };
            
            var informationBtn2 = new SimpleButton()
            {
                Text = "Large Information",
                ItemClick = (ev) =>
                {
                    (new MessageBoxForm(GetRandomText(), MessageBoxLayout.Information)).ShowDialog();
                }
            };
            
			var googlecloudPrintBtn = new SimpleButton()
			{
				Text = "Google Cloud Print",
				ItemClick = (ev) =>
				{
					(new GoogleCloudPrint("https://www.google.com/landing/cloudprint/testpage.pdf", "Test Print")).Show();
				}
			};
			
			var pdfPrintBtn = new SimpleButton()
			{
				Text = "Pdf Preview Form",
				ItemClick = (ev) =>
				{
					(new PDFPreviewForm("https://rawgit.com/samuelGrahame/ExpressCraft/master/Invoice.pdf", PdfSourceType.Url)).Show();
				}
			};
			
			var pdfPrintBase64Btn = new SimpleButton()
			{
				Text = "Pdf Preview Form Base64",
				ItemClick = (ev) =>
				{
					(new PDFPreviewForm("", 
						PdfSourceType.Base64)).Show();
				}
			};
			
			var aceCodeBtn = new SimpleButton()
			{
				Text = "Ace Code Editor",
				ItemClick = (ev) =>
				{
					var frm = new Form() { Text = "Ace Code Editor" };
					var codeEditor = new AceCodeEditor();
					codeEditor.SetBoundsFull();

					frm.LinkchildToForm(codeEditor);

					frm.Body.AppendChild(codeEditor);
					frm.Show();
				}
			};			
			
			var gridLookupEdit = new GridLookupEdit() { DisplayName = "RowContent", FieldName = "RowId" };

			gridLookupEdit.gridView.DataSource = GetTestData();

			var fireBaseSignIn = new SimpleButton()
			{
				Text = "Firebase Test",
				ItemClick = (ev) =>
				{
					if(!Firebase.IsSignedInWithFirebase())
					{						
						Firebase.SignIn();						
					}
					else
					{						
						Firebase.SignOut();
					}

				}
			};			

			AddAndSetPos(errorBtn, exclamationBtn, informationBtn, questionBtn, informationBtn2, googlecloudPrintBtn, aceCodeBtn, dialogTestButton, pdfPrintBtn, pdfPrintBase64Btn, gridLookupEdit, fireBaseSignIn);

			gridLookupEdit.Width = 150;

		}

		public static DataTable GetTestData()
		{
			var dt = new DataTable();

			dt.AddColumn("RowId", DataType.Long);
			dt.AddColumn("RowContent", DataType.String);

			dt.BeginDataUpdate();

			for(int i = 0; i < 1000; i++)
			{				
				dt.AddRow(i, "Content_Value" + i.ToString());
			}

			dt.EndDataUpdate();

			return dt;
		}

		public static void AddAndSetPos(params Control[] data)
		{
			for(int i = 0; i < data.Length; i++)
			{
				var x = data[i].Content;
				x.Style.Position = Position.Relative;
				x.Style.Width = "auto";
			}
			Form.WindowHolder.AppendChildrenTabIndex(data);
		}

        public static string GetRandomText()
        {
            StringBuilder builder = new StringBuilder();

            for (int i = 0; i < 1000; i++)
            {
                builder.Append(r.Next().ToString());
            }
            return builder.ToString();
        }
    }
}